import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchParams((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover filter brightness-50"
          style={{ filter: "brightness(0.7) saturate(0.8)" }}
        />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-white z-10 flex items-center group"
      >
        <svg
          className="w-6 h-6 transform group-hover:-translate-x-1 transition-transform"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M15 19l-7-7 7-7"
          />
        </svg>
        <span className="ml-2 text-lg">Back</span>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen px-4">
        <h1 className="text-5xl font-bold text-white mb-12 text-center leading-tight">
          Let's Find Your Perfect Partner
        </h1>

        <div className="w-full max-w-4xl bg-white/10 backdrop-blur-md rounded-2xl p-8 shadow-2xl">
          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              {/* Location */}
              <div className="col-span-1">
                <label className="block text-white text-sm font-medium mb-2">
                  Location
                </label>
                <input
                  type="text"
                  name="location"
                  value={searchParams.location}
                  onChange={handleChange}
                  className="w-full px-4 py-3 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-teal-500 backdrop-blur-sm transition"
                  placeholder="Enter location"
                />
              </div>

              {/* Organization Type */}
              <div className="col-span-1">
                <label className="block text-white text-sm font-medium mb-2">
                  Organization Type
                </label>
                <select
                  name="orgType"
                  value={searchParams.orgType}
                  onChange={handleChange}
                  className="w-full px-4 py-3 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-teal-500 backdrop-blur-sm transition appearance-none"
                >
                  <option value="" disabled>
                    Select type
                  </option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-Profit</option>
                  <option value="social">Social Enterprise</option>
                  <option value="government">Government</option>
                </select>
              </div>
            </div>

            {/* Partnership Goal */}
            <div className="col-span-2">
              <label className="block text-white text-sm font-medium mb-2">
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                name="partnershipGoal"
                value={searchParams.partnershipGoal}
                onChange={handleChange}
                rows="3"
                className="w-full px-4 py-3 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-teal-500 backdrop-blur-sm transition"
                placeholder="Describe your ideal partnership..."
              />
            </div>

            {/* Search Button */}
            <div className="flex justify-center">
              <button
                type="submit"
                className="px-8 py-3 bg-teal-500 text-white rounded-lg hover:bg-teal-600 transform hover:scale-105 transition-all duration-200 font-medium text-lg shadow-lg hover:shadow-xl"
              >
                Find Partners
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
